@cartwrightjr.kerry Definitely rocking with her regardless. 

Just praying it was immaturity and not narcissism…takes a long time to recover from that.

Hope it’s a happy, healthy marriage and just was a horrible interview. Hope he looks back at the interview and can acknowledge some valid points you made. If we have to make ourselves smaller for our partners to feel adequate, it’s a sign work has to be done for both parties. If we can’t praise our partners and take moments to dim their light even if unintentionally, it’s a problem. I’m no Simone, but it’s a hard lesson many people learn even myself. It often doesn’t end well if it’s not worked on by both parties.
